    false,nt"url": null,nt"notes": "The U.S. Geological Survey's Upper Midwest
    Environmental Sciences Center (UMESC) is in the process of creating high-resolution
    land cover/use data sets for the Upper Mississippi River System (UMRS) from 1:24,000-scale
    color infrared aerial photos collected in 2000. The photos are being interpreted
    using a 1-hectare 10% minimum vegetation cover to delineate land cover/land use,
    percent vegetation cover, tree height, and hydrology regime. The geographic extent
    of the UMRS is the Mississippi River from Cairo, IL to Minneapolis, MN and the Illinois
    River from its confluence with the Mississippi near Grafton, IL to Lake Michigan.",nt"owner_org":
